using System.Collections.Generic;
using System.Diagnostics.CodeAnalysis;
using System.Threading.Tasks;
using YouFoos.DataAccess.Entities.Account;
using YouFoos.DataAccess.Repositories;

namespace YouFoos.DataAccess.SharedTestUtils.TestData
{
    [ExcludeFromCodeCoverage]
    public static class TestAvatars
    {
        public static async Task InsertIntoDatabase(IMongoContext mongoContext, List<UserAvatar> avatars)
        {
            var avatarsRepository = new AvatarsRepository(mongoContext);
            foreach (var avatar in avatars)
            {
                await avatarsRepository.InsertOneAsync(avatar);
            }
        }

        public static List<UserAvatar> GetAllTestAvatars()
        {
            return new List<UserAvatar>()
            {
                TestAvatar1
            };
        }

        public static readonly UserAvatar TestAvatar1 = new UserAvatar(
            userId: TestUsers.TestUser_1.Id, 
            mimeType: "image/png", 
            // ReSharper disable StringLiteralTypo
            base64Image: "data:image/png;base64,");
    }
}
